webpackJsonp([0xefad04ec68e3],{1029:function(e,n){e.exports={data:{package:{id:"bs-rebug",score:.24343688790752574,name:"bs-rebug",version:"0.2.1",description:"Originally a port of [debug](https://github.com/visionmedia/debug) to BuckleScript, but has since expanded a bit.",keywords:["bucklescript","debug"],license:"MIT",updated:"2017-12-17T14:02:15.043Z",stars:null,type:"published",quality:.4116766465412396,popularity:.009542846640158687,maintenance:.3331254217745667,readme:'<h1>rebug</h1>\n<p>Originally a port of <a href="https://github.com/visionmedia/debug">debug</a> to BuckleScript, but has since expanded a bit.</p>\n<h2>Status</h2>\n<ul>\n<li>Browser back-end has been implemented, Node.js back-end has not</li>\n<li>Formatting isn\'t properly supported yet</li>\n<li>Colors are always on</li>\n<li>Isn\'t quite as customizable (yet)</li>\n</ul>\n<h2>Example</h2>\n<pre><code class="language-reason">/* Reason */\n\n/* creates a logger with the given namespace */\nlet debug = Debug.make("my:namespace");\n\n/* debug.log* logs the message only if the namespace of the logger is enabled */\ndebug.log1("The red cow jumps over the lazy giraffe");\n\n/* debug.error* will log the message regardless of whether the namespace is\n   enabled, format it as an error and include a stack trace */\ntry (...) {\n| error => a.error2("Error occurred while doing stuff: ", error)\n};\n\n/* debug.fn* groups any log output during its execution, and logs the arguments\n   passed to and the value returned from the function */\nlet loggedParse = debug.fn1("JSON.parse", Js.Json.parseExn);\n</code></pre>\n<p>See <a href="https://github.com/glennsl/rebug/blob/master/examples/">examples</a> for more.</p>\n<h2>Installation</h2>\n<pre><code class="language-sh">npm install --save bs-rebug\n</code></pre>\n<p>Then add <code>bs-rebug</code> to <code>bs-dependencies</code> in your <code>bsconfig.json</code>:</p>\n<pre><code class="language-js">{\n  ...\n  "bs-dependencies": ["bs-rebug"]\n}\n</code></pre>\n',homepageUrl:null,repositoryUrl:null,npmUrl:"https://www.npmjs.com/package/bs-rebug",issuesUrl:null,slug:"packages/bs-rebug"}},pathContext:{id:"bs-rebug"}}}});
